import React from "react";
import useCookie from "../hooks/useCookie";
import { useNavigate } from "react-router-dom";
import { useSelector } from "react-redux";

const Home = () => {
  const { removeCookie } = useCookie();
  const selector = useSelector((state) => state.account);
  const account = selector.account;
  const navigate = useNavigate();
  const handleSignout = () => {
    removeCookie();
    navigate("/login");
  };
  return (
    <div>
      <h1>Home</h1>
      <div className="  h-[150px] w-[150px] rounded-full border-[1px] border-black relative">
        <img
          src={account?.account?.photoURL}
          alt=""
          className=" absolute w-full h-full rounded-full"
        />
      </div>
      <p>
        Email:<span>{account?.account?.email}</span>
      </p>
      <p>
        Username:<span>{account?.account?.displayName}</span>
      </p>
      <button onClick={handleSignout}>Signout</button>
    </div>
  );
};

export default Home;
